DROP TABLE IF EXISTS `cg_show_detail`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
 SET character_set_client = utf8mb4 ;
CREATE TABLE `cg_show_detail` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '编号',
  `type` tinyint(2) NOT NULL DEFAULT '0' COMMENT '类型（0-产品；1-疗程；2-拼团；3-砍价；4-积分换购；',
  `data_id` int(11) NOT NULL DEFAULT '0' COMMENT '关联数据编号',
  `flag_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '后台选择标记名称（便于后台管理人员选择识别）',
  `title` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '标题',
  `title_sub` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '副标题',
  `img` int(11) NOT NULL DEFAULT '0' COMMENT '商品图片',
  `video_id` int(11) NOT NULL DEFAULT '0' COMMENT '视频id',
  `video_img` int(11) NOT NULL DEFAULT '0' COMMENT '视频封面id',
  `img_show` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '商品多图',
  `summary` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '简介',
  `detail` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci COMMENT '商品详情',
  `detail_other` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci COMMENT '商品其他信息',
  `detail_mobile` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci COMMENT '手机版详情',
  `detail_other_mobile` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci COMMENT '手机版其它信息',
  `sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '状态(0-历史；1-正常；-1-删除)',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(11) NOT NULL DEFAULT '0' COMMENT '更新时间',
  `detail_imgs` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '富文本图片',
  `detail_links` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '图片url',
  `detail_video_id` int(11) NOT NULL DEFAULT '0' COMMENT '详情视频',
  `detail_video_img` int(11) NOT NULL DEFAULT '0' COMMENT '详情视频封面图',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=DYNAMIC COMMENT='展示详情表(作为展示给客户使用)';
