INSERT INTO `cg_system_config` VALUES (1,'cigo','APP_DEV_API_DOC','App开发接口说明文档',0,20,'','请输入文档内容，支持MarkDown编辑','{\"toolbarGroups\":[{\"name\":\"tools\"},{\"name\":\"links\"},{\"name\":\"basicstyles\",\"groups\":[\"basicstyles\",\"cleanup\"]},{\"name\":\"paragraph\",\"groups\":[\"list\",\"indent\",\"blocks\",\"align\",\"bidi\"]},{\"name\":\"styles\"},{\"name\":\"others\"}],\"extraPlugins\":\"markdown\",\"height\":500} ','<h1>本API文档用于&ldquo;嘚瑟&rdquo;项目中手机终端同服务器进行数据交互时使用。</h1>\r\n\r\n<h2>包含模块</h2>\r\n\r\n<ol>\r\n	<li>用户模块（User）：用户相关操作</li>\r\n	<li>系统管理模块（System）：系统管理相关操作</li>\r\n</ol>\r\n\r\n<h2>通信相关</h2>\r\n\r\n<ol>\r\n	<li>通信方式：http＋post ／ http＋get 两种请求方式</li>\r\n	<li>请求参数：键值对（key-value）</li>\r\n	<li>返回数据：为JSON数据json { &quot;status&quot;: 0-失败，1-成功, &quot;msg&quot;: &#39;提示消息&#39;, &quot;errorCode&quot;: &#39;错误编码&#39;, &quot;data&quot;: object-反馈数据 }</li>\r\n</ol>\r\n\r\n<h3>加密通信</h3>\r\n\r\n<p>加密后通信数据分两部分：</p>\r\n\r\n<ol>\r\n	<li>key: 对&ldquo;aes密钥&rdquo;的加密</li>\r\n	<li>cg: 对验证参数的加密(后续待扩展)</li>\r\n	<li>data: 加密后的数据，数据采用JSON格式。</li>\r\n</ol>\r\n\r\n<p>对key部分加密说明：</p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>加密配置说明：</p>\r\n\r\n	<blockquote>\r\n	<pre>\r\n<code>加密类型：RSA\r\n加密长度：1024\r\n加密Padding：OPENSSL_PKCS1_PADDING\r\n</code></pre>\r\n	</blockquote>\r\n	</li>\r\n	<li>\r\n	<p>加密流程说明：</p>\r\n\r\n	<blockquote>\r\n	<pre>\r\n<code>第一步：使用RSA公钥对&quot;aes密钥&quot;进行加密；\r\n第二步：将第一步加密的密文通过base64_encode转码；\r\n第三步：将第二步转码后的字符串通过urlencode对特殊字符进行转码，便于网络传输；\r\n通过以上三步获得适合传输的&quot;aes密钥&quot;密文key。\r\n</code></pre>\r\n	</blockquote>\r\n	</li>\r\n	<li>\r\n	<p>解密流程说明：</p>\r\n\r\n	<blockquote>\r\n	<pre>\r\n<code>第一步：将收到的key值通过urldecode进行解码；；\r\n第二步：将第一步转码后的字符串通过base64_decode进行解码；\r\n第三步：将第二步解码后的字符串通过RSA密钥进行解密；\r\n通过以上三步获得&quot;aes密钥&quot;的明文。\r\n</code></pre>\r\n	</blockquote>\r\n	</li>\r\n</ol>\r\n\r\n<p>对cg部分加密说明：</p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>加密配置说明：</p>\r\n\r\n	<blockquote>\r\n	<pre>\r\n<code>加密类型：AES\r\n加密方法：AES-128-ECB\r\n加密Padding：OPENSSL_PKCS1_PADDING\r\n</code></pre>\r\n	</blockquote>\r\n	</li>\r\n	<li>\r\n	<p>加密流程说明：</p>\r\n\r\n	<blockquote>\r\n	<pre>\r\n<code>第一步：获取验证参数：\r\n1：App发起请求的时间戳 requestTime\r\n第二步：将第一步中所有验证参数成JSON字符串\r\n第三步：使用aes密钥key对要传输&ldquo;JSON数据&rdquo;进行加密；\r\n第四步：将第一步加密的密文通过base64_encode转码；\r\n第五步：将第二步转码后的字符串通过urlencode对特殊字符进行转码，便于网络传输；\r\n通过以上三步获得适合传输的&ldquo;JSON数据&rdquo;密文data。\r\n</code></pre>\r\n	</blockquote>\r\n	</li>\r\n	<li>\r\n	<p>解密流程说明：</p>\r\n\r\n	<blockquote>\r\n	<pre>\r\n<code>第一步：将收到的data值通过urldecode进行解码；；\r\n第二步：将第一步转码后的字符串通过base64_decode进行解码；\r\n第三步：将第二步解码后的字符串通过aes密钥key进行解密；\r\n通过以上三步获得包含所有验证参数的&quot;JSON数据&quot;明文。\r\n</code></pre>\r\n	</blockquote>\r\n	</li>\r\n</ol>\r\n\r\n<p>对data部分加密说明：</p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>加密配置说明：</p>\r\n\r\n	<blockquote>\r\n	<pre>\r\n<code>加密类型：AES\r\n加密方法：AES-128-ECB\r\n加密Padding：OPENSSL_PKCS1_PADDING\r\n</code></pre>\r\n	</blockquote>\r\n	</li>\r\n	<li>\r\n	<p>加密流程说明：</p>\r\n\r\n	<blockquote>\r\n	<pre>\r\n<code>第一步：使用aes密钥key对要传输&ldquo;JSON数据&rdquo;进行加密；\r\n第二步：将第一步加密的密文通过base64_encode转码；\r\n第三步：将第二步转码后的字符串通过urlencode对特殊字符进行转码，便于网络传输；\r\n通过以上三步获得适合传输的&ldquo;JSON数据&rdquo;密文data。\r\n</code></pre>\r\n	</blockquote>\r\n	</li>\r\n	<li>\r\n	<p>解密流程说明：</p>\r\n\r\n	<blockquote>\r\n	<pre>\r\n<code>第一步：将收到的data值通过urldecode进行解码；；\r\n第二步：将第一步转码后的字符串通过base64_decode进行解码；\r\n第三步：将第二步解码后的字符串通过aes密钥key进行解密；\r\n通过以上三步获得&quot;JSON数据&quot;的明文。\r\n</code></pre>\r\n	</blockquote>\r\n	</li>\r\n</ol>\r\n\r\n<h3>非加密通信</h3>\r\n\r\n<p>通信中数据不需要进行加解密，如城市列表的获取。</p>\r\n\r\n<h3>约定常量</h3>\r\n\r\n<p>返回状态</p>\r\n\r\n<ol>\r\n	<li>RES_STATUS_ERROR = 0; //操作异常</li>\r\n	<li>RES_STATUS_SUCCESS = 1; //操作成功</li>\r\n</ol>\r\n\r\n<p>短信验证码操作类型标识</p>\r\n\r\n<ol>\r\n	<li>SMS_VERIFY_CODE_OPT_REGIST = 1; //注册用户</li>\r\n	<li>SMS_VERIFY_CODE_OPT_FIND_PWD_BACK = 2; //找回密码</li>\r\n</ol>\r\n\r\n<p>排序方式</p>\r\n\r\n<ul>\r\n	<li>ORDER_BY_NEW = 0; //最新发布（默认）</li>\r\n	<li>ORDER_BY_HOT_RECENT = 1; //近期热门</li>\r\n	<li>ORDER_BY_HOT_HISTORY = 2; //历史榜单</li>\r\n</ul>\r\n\r\n<p>分页</p>\r\n\r\n<p>默认分页大小为 <strong>10</strong>条。</p>\r\n\r\n<p>数据性别</p>\r\n\r\n<ol>\r\n	<li>SEX_UNKOWN = 0; //保密</li>\r\n	<li>SEX_MAN = 1; //男性</li>\r\n	<li>SEX_WOMEN = 2; //女性</li>\r\n</ol>\r\n\r\n<p>用户图片类型标识</p>\r\n\r\n<ol>\r\n	<li>USER_IMG_FLAG_ICON = &#39;icon&#39;;//用户头像</li>\r\n	<li>USER_IMG_FLAG_BACKGROUND = &#39;background&#39;;用户背景图片</li>\r\n</ol>\r\n\r\n<p>帖子内容类型</p>\r\n\r\n<ol>\r\n	<li>NOTE_TYPE_TEXT = 0;//文字</li>\r\n	<li>NOTE_TYPE_IMG= 1;//图片</li>\r\n	<li>NOTE_TYPE_VIDEO = 2;//视频</li>\r\n</ol>\r\n\r\n<p>App推送标识</p>\r\n\r\n<ul>\r\n	<li>JPUSH_FLAG_NOTIFICATION_TYPE = &#39;type&#39;;//通知类型</li>\r\n	<li>JPUSH_FLAG_NOTIFICATION_DATA_USER_ID = &#39;userId&#39;;//用户编号</li>\r\n	<li>JPUSH_FLAG_NOTIFICATION_DATA_NOTE_ID = &#39;noteId&#39;;//帖子编号</li>\r\n	<li>JPUSH_FLAG_NOTIFICATION_DATA_SPECIAL_EVENT_ID = &#39;specialEventId&#39;;//专题活动编号</li>\r\n	<li>JPUSH_FLAG_NOTIFICATION_DATA_COMMENT_ID = &#39;commentId&#39;;//评论编号</li>\r\n</ul>\r\n\r\n<p>App推送通知类型及说明</p>\r\n\r\n<ul>\r\n	<li>JPUSH_NOTIFICATION_TYPE_SPECIAL_EVENT = 1;//提示专题活动：点击打开专题详情(附属数据：专题活动编号)</li>\r\n	<li>JPUSH_NOTIFICATION_TYPE_YOU_BE_FOLLOWED = 2;//被人关注：点击打开粉丝列表(附属数据：用户编号)</li>\r\n	<li>JPUSH_NOTIFICATION_TYPE_NOTE_BE_LOVED = 3;//帖子被人喜欢：点击打开帖子动态列表(附属数据：帖子编号)</li>\r\n	<li>JPUSH_NOTIFICATION_TYPE_NOTE_BE_COMMENTED = 4;//帖子被人评论：点击打开评论列表(附属数据：帖子编号、评论编号)</li>\r\n	<li>JPUSH_NOTIFICATION_TYPE_COMMENT_BE_REPLYED = 5;//评论被人回复：点击打开对应帖子评论列表(附属数据：帖子编号、评论编号)</li>\r\n</ul>\r\n\r\n<p>动作类型</p>\r\n\r\n<ul>\r\n	<li>ACTION_TYPE_ADD_NOTE = 0;// 发表帖子</li>\r\n	<li>ACTION_TYPE_FOLLOW_USER = 1;// 关注用户</li>\r\n	<li>ACTION_TYPE_LOVE_NOTE = 2;// 喜欢帖子</li>\r\n	<li>ACTION_TYPE_COMMENT = 3;// 评论帖子</li>\r\n	<li>ACTION_TYPE_COMMENT_REPLY = 4;// 回复评论</li>\r\n	<li>ACTION_TYPE_SHARE_NOTE = 5;// 分享了帖子</li>\r\n	<li>ACTION_TYPE_SYSTEM_NOTIFY = 6;// 系统通知</li>\r\n</ul>\r\n\r\n<p>Banner位置</p>\r\n\r\n<ul>\r\n	<li>BANNER_POSITION_APP_HOME_TOP = 1;//App首页顶部</li>\r\n</ul>\r\n\r\n<p>专题活动类型</p>\r\n\r\n<ul>\r\n	<li>SPECIAL_EVENT_TYPE_COMMON = 0;//普通编辑型</li>\r\n	<li>SPECIAL_EVENT_TYPE_URL = 1;//专题活动页面型</li>\r\n</ul>\r\n\r\n<p>数据类型</p>\r\n\r\n<ul>\r\n	<li>DATA_TYPE_NOTE = 7;</li>\r\n	<li>DATA_TYPE_SPECIAL_EVENT = 11;</li>\r\n</ul>\r\n\r\n<p>举报帖子违规类型</p>\r\n\r\n<ul>\r\n	<li>ACCUSATION_TYPE_OTHER = 0;//其它违规</li>\r\n	<li>ACCUSATION_TYPE_SEXY_POLITICAL = 1;//色情、政治敏感</li>\r\n	<li>ACCUSATION_TYPE_ADV_NOUSE= 2;//广告、无聊</li>\r\n	<li>ACCUSATION_TYPE_INFRINGING= 3;//内容侵权、剽窃</li>\r\n</ul>\r\n\r\n<p>错误码</p>\r\n\r\n<ul>\r\n	<li>ERROR_CODE_NOT_EXIST = &#39;1001&#39;;//数据不存在</li>\r\n	<li>ERROR_CODE_ARGS_WRONG = &#39;1002&#39;; //参数错误</li>\r\n	<li>ERROR_CODE_PHONE_ALREADY_EXIT = &#39;1003&#39;; //手机号码已存在</li>\r\n	<li>ERROR_CODE_PHONE_SEND_LIMITED = &#39;1004&#39;;//发送短信超限，详情见提示消息msg</li>\r\n	<li>ERROR_CODE_PHONE_SEND_ERROR_UNKOWN = &#39;1005&#39;;//发送短信未知错误</li>\r\n	<li>ERROR_CODE_PHONE_VERIFY_CODE_ERROR = &#39;1006&#39;;//验证码验证失败</li>\r\n	<li>ERROR_CODE_REQUEST_TYPE_WRONG = &#39;1007&#39;;//请求类型错误</li>\r\n	<li>ERROR_CODE_UNKOWN = &#39;1008&#39;;//未知错误</li>\r\n	<li>ERROR_CODE_USER_NOT_EXIST = &#39;1009&#39;;//用户不存在</li>\r\n	<li>ERROR_CODE_PWD_ERROR = &#39;1010&#39;; //密码错误</li>\r\n	<li>ERROR_CODE_UPLOAD_FILE_TOOBIG = &#39;1011&#39;; //上传图片过大</li>\r\n	<li>ERROR_CODE_UPLOAD_FILE_MIME_ERROR = &#39;1012&#39;;//文件类型错误</li>\r\n	<li>ERROR_CODE_UPLOAD_FILE_EXT_ERROR = &#39;1013&#39;;//文件类型错误</li>\r\n	<li>ERROR_CODE_UPLOAD_PATH_NO_WRITABLE= &#39;1014&#39;;//上传目录不可写</li>\r\n	<li>ERROR_CODE_UPLOAD_PATH_MKDIR_ERROR= &#39;1015&#39;;//上传目录创建失败</li>\r\n	<li>ERROR_CODE_UPLOAD_TMP_FILE_ERROR = &#39;1016&#39;;//上传临时保存文件错误</li>\r\n	<li>ERROR_CODE_UPLOAD_FILE_SAVE_ERROR = &#39;1017&#39;;//保存上传文件错误</li>\r\n	<li>ERROR_CODE_UPLOAD_DB_SAVE_ERROR = &#39;1018&#39;;//保存上传文件数据库错误</li>\r\n	<li>ERROR_CODE_UPLOAD_SAVE_FILE_EXIST_ERROR = &#39;1019&#39;;//保存上传文件重名</li>\r\n	<li>ERROR_CODE_DECRYPT_ERROR = &#39;1020&#39;;//解密失败</li>\r\n	<li>ERROR_CODE_UNALLOWED_REQUEST = &#39;1021&#39;;//非法访问</li>\r\n	<li>ERROR_CODE_NEED_RELOGIN = &#39;1022&#39;;//需要重新登陆</li>\r\n	<li>ERROR_CODE_NEWPWD_EQ_OLDPWD = &#39;1023&#39;;//新旧密码相同</li>\r\n	<li>ERROR_CODE_NICKNAME_ALREADY_INUSE = &#39;1024&#39;;//昵称已被占用</li>\r\n	<li>ERROR_CODE_OTHER_ERROR = &#39;10025&#39;;//其它错误</li>\r\n	<li>ERROR_CODE_RETRY = &#39;10026&#39;;//请重新尝试</li>\r\n	<li>ERROR_CODE_NO_CHANGE = &#39;10027&#39;;//数据无变化</li>\r\n</ul>\r\n\r\n<p>其它非交互常量</p>\r\n\r\n<p>短信限制：短信发送限制规则是1/分钟，5/小时，10/天。 即对于一个应用来说，规则如下：</p>\r\n\r\n<ol>\r\n	<li>一天给同一手机号发送短信不能超过10条;</li>\r\n	<li>一小时给同一手机号发送短信不能超过5条;</li>\r\n	<li>一分钟给同一手机号发送短信不能超过1条。</li>\r\n</ol>\r\n\r\n<h1>API接口详情：</h1>\r\n\r\n<p>详见：<a href=\"api\">接口详情（点击查看）</a></p>\r\n',50,0,0,0,1494161421,1494161421),(2,'cigo','WEB_SITE_ICP','网站备案号',0,31,'请输入网站备案号','设置在网站底部显示的备案号，如“沪ICP备12007941号-2','','',50,1,1,1,1494235786,1494235786),(3,'cigo','CONFIG_GROUP_LIST','配置分组',0,31,'','','','[{\"id\":0,\"text\":\"基本\"},{\"id\":1,\"text\":\"内容\"},{\"id\":2,\"text\":\"用户\"},{\"id\":3,\"text\":\"系统\"}]',100,0,1,0,0,0),(4,'cigo','EDIT_TYPE','编辑类型',3,70,'','','','[ {\"id\":10,\"text\":\"单个输入框\"}, {\"id\":11,\"text\":\"多个输入框\"}, {\"id\":12,\"text\":\"多行文本输入框\"}, {\"id\":20,\"text\":\"日期时间\"}, {\"id\":31,\"text\":\"横向单选框\"}, {\"id\":32,\"text\":\"纵向单选框\"}, {\"id\":33,\"text\":\"横向多选框\"}, {\"id\":34,\"text\":\"纵向多选框\"}, {\"id\":40,\"text\":\"下拉选择框\"}, {\"id\":50,\"text\":\"单图管理\"}, {\"id\":51,\"text\":\"多图管理\"}, {\"id\":52,\"text\":\"图片橱窗管理\"}, {\"id\":60,\"text\":\"百度编辑器\"}, {\"id\":61,\"text\":\"CK编辑器\"}, ]',50,0,1,0,1494292088,1494292088),(5,'cigo','WEB_SITE_KEYWORD','网站关键词',0,70,'请输入网站关键词...','网站搜索引擎关键词，多个关键词用英文“,”隔开','','伙拼吧,购物',50,1,1,1,1494292655,1494292508),(6,'cigo','RSA_PRIVATE_KEY','加密通信RSA私钥',3,70,'请输入RSA私钥','用于APP开发接口加密通信，无特殊需求请勿自行修改。切勿告知他人，切记！切记！切记！','','MIICdgIBADANBgkqhkiG9w0BAQEFAASCAmAwggJcAgEAAoGBAKhIMBSkubsOb2SL\r\n7ZFzQ+oOp+YQp3IHjmfa5oq4wW1bkkAL9i4LFrjQGUl4bOIFvv+Oh87goHK/3Qz2\r\nSlR1ZFxvmlR5qE/wgDftiLj3LKXMWamvEo7Cj2OsJNnysdTtJaHgA/0F6YHDcLDF\r\nXKTQqZ7eN+ZB0qvYTlhtzRjZH+p9AgMBAAECgYByhMWrlroKUPV/UDY4sF88TgL2\r\nbsj0sa24gWA4cSi4ugNZ8In0pXkuBfffZsN6QPzMvvsuzvCBho3wvz6wIT9NCXl9\r\n9bmoiwIgm6PHr5YNk5l89+8UeTigG8uYQ